import React from 'react';
import './App.css';
import Clock from './Clock';
import jsonData from './testinfo.json';
import SingleButtons from './SingleButtons';

const App = () => {
  const handleAnswersSubmit = (userAnswers) => {
    const jsonDataWithAnswers = jsonData.map((questionData, index) => {
      return {
        ...questionData,
        userAnswer: userAnswers[index]
      };
    });

    const jsonDataString = JSON.stringify(jsonDataWithAnswers, null, 2);
    downloadJsonFile(jsonDataString, 'UserAnswers.json');
  };

  const downloadJsonFile = (jsonData, filename) => {
    const blob = new Blob([jsonData], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = url;
    link.download = filename;
    link.click();
  };

  return (
    <div className="app">
      <h1>Test</h1>
      <Clock />
      <div className="question-container">
        {jsonData.map((questionData, index) => {
          if (questionData.type === 'single') {
            return (
              <div key={index}>
                <h1>Type: {questionData.type}</h1>
                <h1>Question: {questionData.question}</h1>
                <SingleButtons
                  options={questionData.options}
                  answer={questionData.answers}
                  onSubmit={handleAnswersSubmit}
                />
              </div>
            );
          } else if (questionData.type === 'whatsNext') {
            return (
              <div key={index}>
                <h1>Type: {questionData.type}</h1>
                <h1>Question: {questionData.question}</h1>
                {/* <WhatsNext options={questionData.options} answer={questionData.answers} /> */}
              </div>
            );
          } else {
            return null;
          }
        })}
      </div>
    </div>
  );
};

export default App;
